bool comparator(const Data* person1, const Data* person2) {
    return !(person1 -> ssn >= person2 -> ssn);
}

void merge_sort(list<Data*>::iterator start, list<Data*>::iterator end) {
    if (distance(start, end) <= 1)
        return;
    auto mid = next(start, distance(start,end)/2);
    merge_sort(start, mid);
    merge_sort(mid, end);
    auto outIt = start;
    merge(start, mid, mid, end, outIt);
}

